$(document).ready(()=>{$("form").on("submit",async a=>{a.preventDefault();const b=$("form");if(!b.checkValidity())return;const c=new FormData(b[0]),d=b.attr("method"),e=b.attr("action");showOverlayPanel(),$.ajax({type:d,data:c,url:e,processData:!1,contentType:!1,success:function(a){hideOverlayPanel(),window.location.href=a.redirect},error:function(a){hideOverlayPanel(),showErrorToast(a.responseJSON.message||a.data)}})})});